import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { ScrollerMotion } from 'scroller-motion';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <ScrollerMotion>
    <App />
  </ScrollerMotion>
);
